import React from 'react';
import Button from '@material-ui/core/Button';
import {Link} from 'react-router-dom';

export default function LoginButton() {

    return (
      <div>
          <Button color="inherit"><Link to='/login'>Login</Link></Button>
      </div>
    );
}
